import {Space, Table, Tag} from '@derbysoft/neat-design';

// Types
import type {FC} from 'react';
import type {ColumnsType} from 'antd/es/table';
import type {Color} from '@derbysoft/neat-design/Tag/Tag';

interface DataType {
    key: string;
    name: string;
    age: number;
    address: string;
    tags: string[];
}

const columns: ColumnsType<DataType> = [{
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
    render: (text) => <a>{text}</a>
}, {
    title: 'Age',
    dataIndex: 'age',
    key: 'age'
}, {
    title: 'Address',
    dataIndex: 'address',
    key: 'address'
}, {
    title: 'Tags',
    key: 'tags',
    dataIndex: 'tags',
    render: (_, {tags}) => (
        <>
            {tags.map((tag) => {
                let color: Color = tag.length > 5 ? 'blue-inverse' : 'green';
                if (tag === 'loser') {
                    color = 'blue';
                }
                color = 'blue-inverse';
                return (
                    <Tag color={color} key={tag}>
                        {tag.toUpperCase()}
                    </Tag>
                );
            })}
        </>
    )
}, {
    title: 'Action',
    key: 'action',
    render: (_, record) => (
        <Space size="middle">
            <a>Invite {record.name}</a>
            <a>Delete</a>
        </Space>
    )
}];

const data: DataType[] = [{
    key: '1',
    name: 'John Brown',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer']
}, {
    key: '2',
    name: 'Jim Green',
    age: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser']
}, {
    key: '3',
    name: 'Joe Black',
    age: 32,
    address: 'Sydney No. 1 Lake Park',
    tags: ['cool', 'teacher']
}];

const App: FC = () => (
    <Table columns={columns}
           dataSource={data}
           rowSelection={{
               type: 'checkbox'
           }}/>
);

export default App;
